ReSharper's NUnit test runner ignores test cases that pass generic types as arguments through the TestCase attribute. In addition, generic type definitions show up as [UnknownType] in the test output tree. See example below.

{code:lang=cs|title=Example}using System;
using NUnit.Framework;
namespace ReSharperBug {
    public class TestBug {
        [TestCase(typeof(bool))]       // Runs OK
        [TestCase(typeof(bool?))]      // Ignored. Shows up as System.Nullable`1[T -> System.Boolean]
        [TestCase(typeof(Nullable<>))] // Ignored. Shows up as System.Nullable`1[T -> JetBrains.ReSharper.Psi.Impl.Types.UnknownType]
        public void Test(Type t) {
            Assert.That(t, Is.Not.Null);
        }
    }
}{code}

PhpStorm uses PhpDoc to know the type of parameters and returned value by a function/method. However it seems not to work for namespace alias.

Consider the following:
{code lang=php}
namespace App\Foo;
use App\Bar\MyClass;
/**
 * @return MyClass
 */
public function getMyClass(MyClass $mc)
{
}
{code}

While PhpStorm does recognize properly the alias (i.e. the type hint "MyClass" for $mc is "linked" to the alias as expected, and when using method getMyClass its parameter will be said to be of type App\Bar\MyClass), the return value will be incorrectly shown as App\Foo\MyClass (i.e. using the current namespace/ignoring the alias)

This unfortunately means that when a function returns a object of a specific class/interface, PhpStorm does not recognize it/list all methods available then.

(FYI if the function above had a tag "@param MyClass $mc" for the parameter, PhpStorm would then see it as either one: App\Bar\MyClass|App\Foo\MyClass)

From Customer Philip Laureano. 


One of the things that me and a few other developers would love to see in R# version >=5.0 is the ability to extract entire classes from an existing class. For example, let's say I have a class named OneBigClass with two sets of logically related methods:

public class OneBigClass
{
    private object _field1;
    private object _field2;
    public void DomainMethod1()
    {
        _field1 = 12345;
    }
    public void DomainMethod2()
    {
        _field1 = 54321;
    }

    public void SomeOtherDomainMethod1()
    {
        _field2 = 12345;
    }
    public void SomeOtherDomainMethod2()
    {
        _field2 = 54321;
    }
}

Ideally, what I would like R# to do is be able to let me choose which methods to extract into a separate class. For this example, let's assume that I wanted to extract methods DomainMethod1 and DomainMethod2. This is what the output should look like:

public class OneSmallerClass
{
    private object _field1;
    public void DomainMethod1()
    {
        _field1 = 12345;
    }
    public void DomainMethod2()
    {
        _field1 = 54321;
    }
}

The OneBigClass class should now look like this:

public class OneBigClass
{
    private object _field1;
    private OneSmallerClass _smallClass = new OneSmallerClass();
    public void DomainMethod1()
    {
        _field1 = 12345;
    }
    public void DomainMethod2()
    {
        _field1 = 54321;
    }

    public void SomeOtherDomainMethod1()
    {
        _smallClass.SomeOtherDomainMethod1();
    }
    public void SomeOtherDomainMethod2()
    {
       _smallClass.SomeOtherDomainMethod1();
    }
}

Extract method is a good tool, but having to manually extract large classes can be quite tedious with the large codebases. Is there any way that you can pass this off to the Jetbrains R# devs? Thanks a lot, dude!


