Currently (as of PyCharm 2.0 EAP 108.1348 anyway), the Javascript skeleton and inspection only implements the {{console.log}} method of [the Console API|http://getfirebug.com/wiki/index.php/Console_API].

It would be nice and useful if it implemented the rest of the functions as well, or at least the well-supported ones:
* {{console.debug}}, {{console.info}}, {{console.warn}} and {{console.error}} which have the same signature as {{console.log}} (both forms)
* {{console.assert}}, which takes an expression to evaluate as its first parameter and otherwise behaves much like the first form of {{console.log}} (the one without a format string)
* {{console.dir(Object)}}
* {{console.dirxml(Node)}}
* {{console.group(Object[, Object..]}} and {{console.groupCollapsed(Object[, Object..])}} as well as {{console.groupEnd()}}
* {{console.trace()}}, which simply prints the current traceback to the console
* {{console.time(id:String)}} and {{console.timeEnd(id:String)}} which take a single matching parameter (they can be interspersed, there should always be at least one {{timeEnd}} matching a called {{time}})
* {{console.profile([title:String])}} and {{console.profileEnd()}}
* {{console.count([id:String])}}

There are also {{console.exception(Error[, Object...])}} and {{console.table(Array<Array>|Array<Object>[, Array<String>|Array<Object>])}}, but they don't seem implemented at all outside of Firebug

