According to cocoa memory guidelines, the object created by a method named copy* is owned by the caller of the method, not the class defining the method. With that in mind, the line in -[copyFoo] below is incorrectly flagged with a memory leak warning ("Retained value may not have been release"):

{code}
- (id)copyFoo {
  return [foo copy];
}
{code}

From [Apple's memory management guidelines:|http://developer.apple.com/library/mac/#documentation/Cocoa/Conceptual/MemoryMgmt/Articles/mmRules.html#//apple_ref/doc/uid/20000994-SW1]
{quote}
'''You own any object you create'''
You create an object using a method whose name begins with “alloc”, “new”, “copy”, or “mutableCopy” (for example, alloc, newObject, or mutableCopy).
{quote}

