In UIViewController code, the paradigm is to do:

- (void)dealloc
{
    [self viewDidUnload];

    [super dealloc];
}

'view' variables are supposed to be released in viewDidUnload, which is called from dealloc.  AppCode is reporting that the variables (which are released in viewDidUnload), are not released, even though they are, through the call to viewDidUnload in the dealloc method.  AppCode should be smart about what dealloc is calling before it reports certain variables are not being released.

