ReSharper showed a blue squiggly underline under the "MyEnum" property name, with tooltip "Property 'MyEnum MyEnum' hides enum from outer class".

This is not a valid / meaningful message. This property doesn't hide anything; it doesn't prevent me from working with the enum in any way. If I want to write code in my Inner class that works with the MyEnum type, I can -- there's nothing stopping me from referring to MyEnum.Zero inside my inner class, or referring to typeof(MyEnum) or List<MyEnum>.

If the property were of a *different* type -- say, "public string MyEnum { get; set; }" -- then the warning would make sense, because then I would be unable to refer to the MyEnum type from my inner class. But because the type is the same as the property name, the compiler has no trouble figuring things out, and ReSharper's warning is incorrect.

ReSharper shouldn't show this warning when the property type is the same as the property name.

