A number of JsDoc annotations can take types as parameters (potentially optional): {{@extends}}, {{@lends}}, {{@param}}, …

This work well for "global" types (native or not), but it breaks down when using the so-called module pattern:
{code lang=javascript}
var a = (function () {
    var a = {};

    /**
     * @class
     */
    a.Foo = function () {

    };

    /**
     * @class
     */
    function Baz() {}

    /**
     * @class
     * @param {a.Foo} foo
     * @param {Baz} baz
     */
    a.Bar = function (foo, baz) {

    };
    return a;
});
{code}
Here, both {{a.Foo}} and {{Baz}} in the signature of {{a.Baz}} will be warned against, with the message "Unresolved variable or type", even though using the actual types {{a.Foo}} or {{Baz}} within {{a.Bar}} will work without any issue and correctly hyperlink.

JsDoc type resolutions should use the same lexical scoping process as regular type (or variable) resolution.

