Suggestion that would be something I've never seen on a debugger but would make PhpStorm even better than it already is: ''Enable a Breakpoint Condition to be in a Downstream Frame of a Bookmark.''

==Use-Case==

Very frequently I need to test a value while tracing through is a library function within framework/CMS (the generated SQL value in {{$wpdb->query()}} within WordPress comes to mind) yet the function gets called many tens of times before the context I'm interested in.  What I want to be able to do is say "''Break on this line in the ''{{$wpdb}}'' function ''{{query()}}'' but only when (indirectly) called downstream/downframe of '''{{my_func()}}."  

==Request==

So what I'd like to do is set a bookmark on the line of my code that either calls {{$wpdb->query()}} directly or indirectly and then when I set a breakpoint on a line within {{$wpdb->query()}} I'd like to ''very easily'' (i.e. without having to open a dialog box) be able to specify that the breakpoint condition's is to only be active when I'm downstream/downframe from my own function. (It's important that selecting the bookmark as a condition is really easy and doesn't require lots of clicking and/or manual dexterity since I'd be using this feature constantly and if not easy to set it could take a developer's mind out of "''flow''".)

==Rationale==

Having such functionality would make most of my debugging sessions 10x more productive. Literally. 

==Example as Workaround==

To ensure you understand what I'm asking for I'll explain how I do it when i really, really need to do it (I don't do it often because doing so is tedious and requires I add and later remove code the latter of which I don't want to forget to do.)

Assuming {{my_func()}} calls a function that ultimately calls {{$wpdb->query()}} I'll add the following code inside {{$wpdb->query()}} and set the breakpoint on the echo statement which allows me to see the breakpoint only when downstream of {{my_func()}}:

{code lang=php}
if (func_in_callstack('my_func')) {
   echo '';
} 
{code}

Doing this of code requires that I've added the follow code to my project somewhere, typically within my WordPress theme's {{functions.php}} file:

{code lang=php}
function func_in_callstack() {
	$functions = func_get_args();
	$in_callstack = false;
	foreach(debug_backtrace() as $level)
		if (in_array($level["function"],$functions)) {
			$in_callstack = true;
			break;
		}
	return $in_callstack;
}
{code}

==Applicability==

Of course it's possible that at first glance {{XDEBUG}} doesn't support such a feature but I believe you could simulate it using a function like one above but hidden by the IDE.  

==Appeal==

I do so hope you'll consider adding such a feature to a future version of PhpStorm.

